import React from 'react'
import Web from '../src/images/img-1.png'
import { NavLink } from "react-router-dom"
import Common from './Common'

const Home =() => {
    return(
      <>
      <Common 
      name="Hey Im" 
      strong="About Us"
      imgsrc={Web} 
      visit="/service" 
      btname="Get Started"/>
      </>
    )
  }

  export default Home;
